$(function(){$("#nav").mouseenter(function(){$(this).parent().find("#levelBg").stop(!0,!0).slideDown(400,"easeOutExpo"),$(this).find("#level").css({display:"block"})}).mouseleave(function(){$(this).parent().find("#levelBg").stop(!0,!0).slideUp(600,"easeOutExpo"),$(this).find("#level").css({display:"none"})})});